      pf = interpolate_partition_functions(jc13, state % T)
      rate_eval % unscreened_rates(i_rate, k_c13__n_c12) = rate_eval % unscreened_rates(i_rate, k_c13__n_c12) / pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_c13__n_c12) = rate_eval % unscreened_rates(i_drate_dt, k_c13__n_c12) / pf(1) - rate_eval % unscreened_rates(i_rate, k_c13__n_c12) * pf(2) / pf(1)**2

      pf = interpolate_partition_functions(jn, state % T)
      rate_eval % unscreened_rates(i_rate, k_c14__n_c13) = rate_eval % unscreened_rates(i_rate, k_c14__n_c13) * pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_c14__n_c13) = rate_eval % unscreened_rates(i_drate_dt, k_c14__n_c13) * pf(1) + rate_eval % unscreened_rates(i_rate, k_c14__n_c13) * pf(2)

